import React from 'react';
import SplitPane from 'react-split-pane';
import './App.css';

function App() {
  return (
    <div className="App">
      <SplitPane
      split='vertical'
      defaultSize='45%'
      >
        <div class="left"></div>
        <div class="right"></div>
      </SplitPane>
    </div>
  );
}

export default App;
